import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useProgress } from '../context/ProgressContext';
import './Dashboard.css';

const Dashboard = () => {
  const navigate = useNavigate();
  const { progress } = useProgress();

  const games = [
    {
      id: 'quantityComparison',
      title: 'Quantity Comparison',
      description: 'Compare quantities visually (More, Less, Same)',
      icon: 'üçé',
      route: '/game/quantity-comparison',
      color: '#FFE5A5'
    },
    {
      id: 'numberLineAddition',
      title: 'Number Line Addition',
      description: 'Learn addition through visual movement',
      icon: '‚ûï',
      route: '/game/number-line-addition',
      color: '#A5C8FF'
    },
    {
      id: 'patternRecognition',
      title: 'Pattern Recognition',
      description: 'Identify and complete patterns',
      icon: 'üé®',
      route: '/game/pattern-recognition',
      color: '#D4A5FF'
    },
    {
      id: 'numberSequencing',
      title: 'Number Sequencing',
      description: 'Arrange numbers in the correct order',
      icon: 'üî¢',
      route: '/game/number-sequencing',
      color: '#FFD4A5'
    }
  ];

  const getAccuracy = (gameId) => {
    const gameProgress = progress[gameId];
    if (!gameProgress || gameProgress.completed === 0) return 0;
    return Math.round((gameProgress.correct / gameProgress.completed) * 100);
  };

  return (
    <div className="pastel-background dashboard-page">
      <button className="nav-button back-button" onClick={() => navigate('/')}>‚Üê Home</button>
      <div className="content-container">
        <h1 className="heading">Choose Your Game</h1>
        <p className="subtitle">Select an activity to practice your math skills</p>
        <div className="games-grid">
          {games.map((game) => (
            <div
              key={game.id}
              className="game-card"
              onClick={() => navigate(game.route)}
              style={{ borderColor: game.color }}
            >
              <div className="game-icon" style={{ background: game.color }}>{game.icon}</div>
              <h2>{game.title}</h2>
              <p className="game-description">{game.description}</p>
              <div className="game-stats">
                <div className="stat-item">
                  <span className="stat-label">Level</span>
                  <span className="stat-value">{progress[game.id]?.level || 1}</span>
                </div>
                <div className="stat-item">
                  <span className="stat-label">Completed</span>
                  <span className="stat-value">{progress[game.id]?.completed || 0}</span>
                </div>
                <div className="stat-item">
                  <span className="stat-label">Accuracy</span>
                  <span className="stat-value">{getAccuracy(game.id)}%</span>
                </div>
              </div>
              <button className="play-button" style={{ background: game.color }}>
                Play Now ‚Üí
              </button>
            </div>
          ))}
        </div>
        <div className="quick-actions">
          <button className="btn btn-secondary" onClick={() => navigate('/parent-dashboard')}>
            üìä View Progress
          </button>
          <button className="btn btn-secondary" onClick={() => navigate('/settings')}>
            ‚öôÔ∏è Settings
          </button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
